import mysql.connector

def DBtoArray(db,arrayName):
    cursr = db.cursor(dictionary=True)
    cursr.execute("SELECT * FROM " + arrayName)
    rslt = cursr.fetchall()
    ray = []
    for idx in rslt:
        ray += [idx[list(idx.keys())[0]]]
    return ray

